import axios from "axios";

const url = axios.create({
    baseURL: 'http://localhost:8080/v1/',
});

const Subject = ({course, subjects, setSubjects}) => {

    useEffect(() => {
        const get_subjects = () => {
            return url
                .get('/subjects')
                .then((response) => {
                    return response.data;
                })
                .catch((error) => {
                    return error;
                })
        }

        const get_data = async () => {
            let subjects = await get_subjects();

